// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// ============================================
// 1. GEOGRAPHIC MANAGEMENT CONTRACT
// Handles: Provinces & Constituencies
// ============================================
contract GeographicManagement {
    
    address public admin;
    
    // Province structure
    struct Province {
        string name;
        bool exists;
    }
    
    // Constituency structure
    struct Constituency {
        string name;
        string province;
        bool exists;
    }
    
    // Storage
    string[] public provinces;
    mapping(string => bool) public isProvinceAdded;
    mapping(string => string[]) public constituenciesByProvince;
    mapping(string => mapping(string => bool)) public isConstituencyAdded;
    
    // Events
    event ProvinceAdded(string indexed province);
    event ProvinceRemoved(string indexed province);
    event ConstituencyAdded(string indexed province, string indexed constituency);
    event ConstituencyRemoved(string indexed province, string indexed constituency);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    // ✅ FIXED: Constructor now accepts VotingMachine address
    constructor(address _votingMachine) {
        admin = _votingMachine;
    }
    
    // Add Province
    function addProvince(string memory _province) external onlyAdmin {
        require(bytes(_province).length > 0, "Province name cannot be empty");
        require(!isProvinceAdded[_province], "Province already exists");
        
        provinces.push(_province);
        isProvinceAdded[_province] = true;
        
        emit ProvinceAdded(_province);
    }
    
    // Remove Province
    function removeProvince(string memory _province) external onlyAdmin {
        require(isProvinceAdded[_province], "Province does not exist");
        require(constituenciesByProvince[_province].length == 0, "Remove all constituencies first");
        
        isProvinceAdded[_province] = false;
        
        for (uint256 i = 0; i < provinces.length; i++) {
            if (keccak256(bytes(provinces[i])) == keccak256(bytes(_province))) {
                provinces[i] = provinces[provinces.length - 1];
                provinces.pop();
                break;
            }
        }
        
        emit ProvinceRemoved(_province);
    }
    
    // View all Provinces
    function viewProvinces() external view returns (string[] memory) {
        return provinces;
    }
    
    // Add Constituency
    function addConstituency(string memory _province, string memory _constituency) external onlyAdmin {
        require(isProvinceAdded[_province], "Province does not exist");
        require(bytes(_constituency).length > 0, "Constituency name cannot be empty");
        require(!isConstituencyAdded[_province][_constituency], "Constituency already exists");
        
        constituenciesByProvince[_province].push(_constituency);
        isConstituencyAdded[_province][_constituency] = true;
        
        emit ConstituencyAdded(_province, _constituency);
    }
    
    // Remove Constituency
    function removeConstituency(string memory _province, string memory _constituency) external onlyAdmin {
        require(isConstituencyAdded[_province][_constituency], "Constituency does not exist");
        
        isConstituencyAdded[_province][_constituency] = false;
        
        string[] storage constituencies = constituenciesByProvince[_province];
        for (uint256 i = 0; i < constituencies.length; i++) {
            if (keccak256(bytes(constituencies[i])) == keccak256(bytes(_constituency))) {
                constituencies[i] = constituencies[constituencies.length - 1];
                constituencies.pop();
                break;
            }
        }
        
        emit ConstituencyRemoved(_province, _constituency);
    }
    
    // View Constituencies by Province
    function viewConstituenciesByProvince(string memory _province) external view returns (string[] memory) {
        require(isProvinceAdded[_province], "Province does not exist");
        return constituenciesByProvince[_province];
    }
    
    // Get total counts
    function getCounts() external view returns (uint256 provinceCount, uint256 constituencyCount) {
        uint256 totalConstituencies = 0;
        for (uint256 i = 0; i < provinces.length; i++) {
            totalConstituencies += constituenciesByProvince[provinces[i]].length;
        }
        return (provinces.length, totalConstituencies);
    }
}

contracts/2_PartyManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// ============================================
// 2. PARTY MANAGEMENT CONTRACT
// Handles: Political Parties
// ============================================
contract PartyManagement {
    
    address public admin;
    
    struct Party {
        string name;
        bool exists;
    }
    
    // Storage
    string[] public parties;
    mapping(string => Party) public partyDetails;
    mapping(string => bool) public isPartyRegistered;
    
    // Events
    event PartyAdded(string indexed partyName);
    event PartyRemoved(string indexed partyName);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    // ✅ FIXED: Constructor now accepts VotingMachine address
    constructor(address _votingMachine) {
        admin = _votingMachine;
    }
    
    // Add Party
    function addParty(string memory _partyName) external onlyAdmin {
        require(bytes(_partyName).length > 0, "Party name cannot be empty");
        require(!isPartyRegistered[_partyName], "Party already registered");
        
        parties.push(_partyName);
        partyDetails[_partyName] = Party(_partyName, true);
        isPartyRegistered[_partyName] = true;
        
        emit PartyAdded(_partyName);
    }
    
    // Remove Party
    function removeParty(string memory _partyName) external onlyAdmin {
        require(isPartyRegistered[_partyName], "Party does not exist");
        
        isPartyRegistered[_partyName] = false;
        delete partyDetails[_partyName];
        
        for (uint256 i = 0; i < parties.length; i++) {
            if (keccak256(bytes(parties[i])) == keccak256(bytes(_partyName))) {
                parties[i] = parties[parties.length - 1];
                parties.pop();
                break;
            }
        }
        
        emit PartyRemoved(_partyName);
    }
    
    // View all Parties
    function viewParties() external view returns (string[] memory) {
        return parties;
    }
    
    // Get total count
    function getPartyCount() external view returns (uint256) {
        return parties.length;
    }
}

contracts/3_CandidateManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// ============================================
// 3. CANDIDATE MANAGEMENT CONTRACT
// Handles: Candidate Registration & Management
// ============================================
import "./1_GeographicManagement.sol";
import "./2_PartyManagement.sol";

contract CandidateManagement {
    
    address public admin;
    GeographicManagement public geoContract;
    PartyManagement public partyContract;
    
    struct Candidate {
        uint256 id;
        uint256 cnic;
        string name;
        string province;
        string constituency;
        string party;
        bool exists;
    }
    
    // Storage
    mapping(uint256 => Candidate) public candidates;
    mapping(uint256 => bool) public isCandidateCnicRegistered;
    mapping(string => mapping(string => uint256[])) public candidatesInConstituency;
    mapping(string => mapping(string => mapping(string => uint256))) public candidateByParty;
    
    uint256 public candidateCount;
    
    // Events
    event CandidateRegistered(uint256 indexed candidateId, string name, string party, string constituency);
    event CandidateRemoved(uint256 indexed candidateId);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    // ✅ FIXED: Constructor now accepts VotingMachine address
    constructor(address _votingMachine, address _geoContract, address _partyContract) {
        admin = _votingMachine;
        geoContract = GeographicManagement(_geoContract);
        partyContract = PartyManagement(_partyContract);
    }
    
    // Register Candidate
    function registerCandidate(
        uint256 _cnic,
        string memory _name,
        string memory _province,
        string memory _constituency,
        string memory _party
    ) external onlyAdmin returns (uint256) {
        require(!isCandidateCnicRegistered[_cnic], "CNIC already registered as candidate");
        require(geoContract.isProvinceAdded(_province), "Province does not exist");
        require(geoContract.isConstituencyAdded(_province, _constituency), "Constituency does not exist");
        require(partyContract.isPartyRegistered(_party), "Party not registered");
        require(
            candidateByParty[_province][_constituency][_party] == 0,
            "Party already has candidate in this constituency"
        );
        
        candidateCount++;
        
        candidates[candidateCount] = Candidate(
            candidateCount,
            _cnic,
            _name,
            _province,
            _constituency,
            _party,
            true
        );
        
        isCandidateCnicRegistered[_cnic] = true;
        candidatesInConstituency[_province][_constituency].push(candidateCount);
        candidateByParty[_province][_constituency][_party] = candidateCount;
        
        emit CandidateRegistered(candidateCount, _name, _party, _constituency);
        return candidateCount;
    }
    
    // Remove Candidate
    function removeCandidate(uint256 _candidateId) external onlyAdmin {
        require(candidates[_candidateId].exists, "Candidate does not exist");
        
        Candidate memory candidate = candidates[_candidateId];
        
        // Remove from mappings
        isCandidateCnicRegistered[candidate.cnic] = false;
        candidateByParty[candidate.province][candidate.constituency][candidate.party] = 0;
        
        // Remove from constituency array
        uint256[] storage constCandidates = candidatesInConstituency[candidate.province][candidate.constituency];
        for (uint256 i = 0; i < constCandidates.length; i++) {
            if (constCandidates[i] == _candidateId) {
                constCandidates[i] = constCandidates[constCandidates.length - 1];
                constCandidates.pop();
                break;
            }
        }
        
        delete candidates[_candidateId];
        
        emit CandidateRemoved(_candidateId);
    }
    
    // View Candidate
    function viewCandidate(uint256 _candidateId) external view returns (
        uint256 id,
        uint256 cnic,
        string memory name,
        string memory province,
        string memory constituency,
        string memory party
    ) {
        require(candidates[_candidateId].exists, "Candidate does not exist");
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.id, candidate.cnic, candidate.name, candidate.province, candidate.constituency, candidate.party);
    }
    
    // View Candidates by Constituency
    function viewCandidatesByConstituency(string memory _province, string memory _constituency) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return candidatesInConstituency[_province][_constituency];
    }
    
    // Get Candidate Count
    function getCandidateCount() external view returns (uint256) {
        return candidateCount;
    }
    
    // Check if candidate exists in constituency
    function candidateExistsInConstituency(
        string memory _province,
        string memory _constituency,
        string memory _party
    ) external view returns (bool) {
        return candidateByParty[_province][_constituency][_party] != 0;
    }
}

contracts/4_VoterManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// ============================================
// 4. VOTER MANAGEMENT CONTRACT
// Handles: Voter Registration & Management
// ============================================
import "./1_GeographicManagement.sol";

contract VoterManagement {
    
    address public admin;
    address public votingProcessContract;
    GeographicManagement public geoContract;
    
    struct Voter {
        uint256 cnic;
        string name;
        string province;
        string constituency;
        bytes32 passwordHash;
        bool isRegistered;
        bool hasVoted;
        bytes32 secretKeyHash;
    }
    
    // Storage
    mapping(uint256 => Voter) public voters;
    mapping(uint256 => bool) public isVoterCnicRegistered;
    uint256 public voterCount;
    
    // Track all registered CNICs for batch reset
    uint256[] private registeredCnics;
    mapping(uint256 => bool) private isCnicTracked;
    
    // Events
    event VoterRegistered(uint256 indexed cnic, string name, string constituency);
    event VoterRemoved(uint256 indexed cnic);
    event VoterMarkedAsVoted(uint256 indexed cnic);
    event VotingProcessSet(address indexed votingProcess);
    event VoterResetForNewElection(uint256 indexed cnic);
    event AllVotersResetForNewElection(uint256 count, uint256 timestamp);
    event VoterPasswordChanged(uint256 indexed cnic, uint256 timestamp); // ✅ NEW
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    modifier onlyAuthorized() {
        require(
            msg.sender == admin || msg.sender == votingProcessContract,
            "Only admin or VotingProcess can call this"
        );
        _;
    }
    
    constructor(address _votingMachine, address _geoContract) {
        admin = _votingMachine;
        geoContract = GeographicManagement(_geoContract);
    }
    
    function setVotingProcessContract(address _votingProcess) external onlyAdmin {
        require(_votingProcess != address(0), "Invalid address");
        votingProcessContract = _votingProcess;
        emit VotingProcessSet(_votingProcess);
    }
    
    // Register Voter
    function registerVoter(
        uint256 _cnic,
        string memory _name,
        string memory _province,
        string memory _constituency,
        string memory _password
    ) external onlyAdmin {
        require(!isVoterCnicRegistered[_cnic], "CNIC already registered");
        require(geoContract.isProvinceAdded(_province), "Province does not exist");
        require(geoContract.isConstituencyAdded(_province, _constituency), "Constituency does not exist");
        require(bytes(_password).length >= 6, "Password must be at least 6 characters");
        
        bytes32 passwordHash = keccak256(abi.encodePacked(_password));
        
        voters[_cnic] = Voter(
            _cnic,
            _name,
            _province,
            _constituency,
            passwordHash,
            true,
            false,
            bytes32(0)
        );
        
        isVoterCnicRegistered[_cnic] = true;
        voterCount++;
        
        if (!isCnicTracked[_cnic]) {
            registeredCnics.push(_cnic);
            isCnicTracked[_cnic] = true;
        }
        
        emit VoterRegistered(_cnic, _name, _constituency);
    }
    
    // Batch Register Voters
    function batchRegisterVoters(
        uint256[] memory _cnics,
        string[] memory _names,
        string[] memory _provinces,
        string[] memory _constituencies,
        string[] memory _passwords
    ) external onlyAdmin {
        require(
            _cnics.length == _names.length &&
            _names.length == _provinces.length &&
            _provinces.length == _constituencies.length &&
            _constituencies.length == _passwords.length,
            "Array length mismatch"
        );
        
        for (uint256 i = 0; i < _cnics.length; i++) {
            if (!isVoterCnicRegistered[_cnics[i]]) {
                bytes32 passwordHash = keccak256(abi.encodePacked(_passwords[i]));
                
                voters[_cnics[i]] = Voter(
                    _cnics[i],
                    _names[i],
                    _provinces[i],
                    _constituencies[i],
                    passwordHash,
                    true,
                    false,
                    bytes32(0)
                );
                
                isVoterCnicRegistered[_cnics[i]] = true;
                voterCount++;
                
                if (!isCnicTracked[_cnics[i]]) {
                    registeredCnics.push(_cnics[i]);
                    isCnicTracked[_cnics[i]] = true;
                }
                
                emit VoterRegistered(_cnics[i], _names[i], _constituencies[i]);
            }
        }
    }
    
    // Remove Voter
    function removeVoter(uint256 _cnic) external onlyAdmin {
        require(voters[_cnic].isRegistered, "Voter does not exist");
        
        isVoterCnicRegistered[_cnic] = false;
        delete voters[_cnic];
        voterCount--;
        
        emit VoterRemoved(_cnic);
    }
    
    // ✅ NEW: Change voter password (keeps everything else intact)
    function changeVoterPassword(
        uint256 _cnic,
        bytes32 _currentPasswordHash,
        string memory _newPassword
    ) external onlyAdmin {
        require(voters[_cnic].isRegistered, "Voter not registered");
        require(voters[_cnic].passwordHash == _currentPasswordHash, "Current password incorrect");
        require(bytes(_newPassword).length >= 6, "New password must be at least 6 characters");
        
        bytes32 newPasswordHash = keccak256(abi.encodePacked(_newPassword));
        require(newPasswordHash != _currentPasswordHash, "New password must be different");
        
        voters[_cnic].passwordHash = newPasswordHash;
        
        emit VoterPasswordChanged(_cnic, block.timestamp);
    }
    
    // Reset single voter for new election (keeps password & personal data)
    function resetVoterForNewElection(uint256 _cnic) external onlyAdmin {
        require(voters[_cnic].isRegistered, "Voter not registered");
        
        voters[_cnic].hasVoted = false;
        voters[_cnic].secretKeyHash = bytes32(0);
        
        emit VoterResetForNewElection(_cnic);
    }
    
    // Reset ALL voters for new election (batch operation)
    function resetAllVotersForNewElection() external onlyAdmin returns (uint256) {
        uint256 resetCount = 0;
        
        for (uint256 i = 0; i < registeredCnics.length; i++) {
            uint256 cnic = registeredCnics[i];
            
            if (voters[cnic].isRegistered) {
                voters[cnic].hasVoted = false;
                voters[cnic].secretKeyHash = bytes32(0);
                resetCount++;
                
                emit VoterResetForNewElection(cnic);
            }
        }
        
        emit AllVotersResetForNewElection(resetCount, block.timestamp);
        return resetCount;
    }
    
    // View Voter
    function viewVoter(uint256 _cnic) external view returns (
        uint256 cnic,
        string memory name,
        string memory province,
        string memory constituency,
        bool hasVoted,
        bool isRegistered
    ) {
        Voter memory voter = voters[_cnic];
        return (voter.cnic, voter.name, voter.province, voter.constituency, voter.hasVoted, voter.isRegistered);
    }
    
    // Mark voter as voted
    function markAsVoted(uint256 _cnic) external onlyAuthorized {
        require(voters[_cnic].isRegistered, "Voter not registered");
        require(!voters[_cnic].hasVoted, "Already marked as voted");
        voters[_cnic].hasVoted = true;
        emit VoterMarkedAsVoted(_cnic);
    }
    
    // Set secret key hash
    function setSecretKeyHash(uint256 _cnic, bytes32 _secretKeyHash) external onlyAuthorized {
        require(voters[_cnic].isRegistered, "Voter not registered");
        voters[_cnic].secretKeyHash = _secretKeyHash;
    }
    
    // Verify voter credentials
    function verifyVoterCredentials(uint256 _cnic, bytes32 _passwordHash) external view returns (bool) {
        return voters[_cnic].isRegistered && voters[_cnic].passwordHash == _passwordHash;
    }
    
    // Get voter constituency
    function getVoterConstituency(uint256 _cnic) external view returns (string memory province, string memory constituency) {
        require(voters[_cnic].isRegistered, "Voter not registered");
        return (voters[_cnic].province, voters[_cnic].constituency);
    }
    
    // Get voter secret key hash
    function getVoterSecretKeyHash(uint256 _cnic) external view returns (bytes32) {
        require(voters[_cnic].isRegistered, "Voter not registered");
        return voters[_cnic].secretKeyHash;
    }
    
    // Get voter count
    function getVoterCount() external view returns (uint256) {
        return voterCount;
    }
    
    // Get all registered CNICs
    function getAllRegisteredCnics() external view returns (uint256[] memory) {
        uint256[] memory activeCnics = new uint256[](voterCount);
        uint256 index = 0;
        
        for (uint256 i = 0; i < registeredCnics.length; i++) {
            uint256 cnic = registeredCnics[i];
            if (voters[cnic].isRegistered) {
                activeCnics[index] = cnic;
                index++;
            }
        }
        
        return activeCnics;
    }
}

contracts/5_VotingProcess.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// ============================================
// 5. VOTING PROCESS CONTRACT
// Handles: Vote Casting & Verification
// ============================================
import "./4_VoterManagement.sol";
import "./3_CandidateManagement.sol";

contract VotingProcess {
    
    address public admin;
    VoterManagement public voterContract;
    CandidateManagement public candidateContract;
    
    bool public votingActive;
    uint256 public votingStartTime;
    uint256 public votingEndTime;
    
    // Vote storage
    mapping(uint256 => bytes32) public voteHashes; // cnic => vote hash
    mapping(uint256 => uint256) public votes; // cnic => candidateId (changed to public for result counting)
    
    // Events
    event VotingStarted(uint256 startTime, uint256 endTime);
    event VotingEnded(uint256 endTime);
    event SecretKeyRegistered(uint256 indexed voterCnic);
    event VoteCast(uint256 indexed voterCnic, bytes32 voteHash, uint256 timestamp);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    modifier withinVotingPeriod() {
        require(votingActive, "Voting is not active");
        require(block.timestamp >= votingStartTime, "Voting has not started yet");
        require(block.timestamp <= votingEndTime, "Voting has ended");
        _;
    }
    
    // ✅ FIXED: Constructor now accepts VotingMachine address
    constructor(address _votingMachine, address _voterContract, address _candidateContract) {
        admin = _votingMachine;
        voterContract = VoterManagement(_voterContract);
        candidateContract = CandidateManagement(_candidateContract);
        votingActive = false;
    }
    
    // Start Voting
    function startVoting(uint256 _durationInHours) external onlyAdmin {
        require(!votingActive, "Voting is already active");
        require(_durationInHours > 0, "Duration must be greater than 0");
        
        votingStartTime = block.timestamp;
        votingEndTime = block.timestamp + (_durationInHours * 1 hours);
        votingActive = true;
        
        emit VotingStarted(votingStartTime, votingEndTime);
    }
    
    // Stop Voting
    function stopVoting() external onlyAdmin {
        require(votingActive, "Voting is not active");
        
        votingActive = false;
        votingEndTime = block.timestamp;
        
        emit VotingEnded(votingEndTime);
    }
    
    // Register Secret Key (Step 1 of voting)
    function registerSecretKey(
        uint256 _voterCnic,
        string memory _password,
        string memory _secretKey
    ) external withinVotingPeriod {
        bytes32 passwordHash = keccak256(abi.encodePacked(_password));
        
        require(voterContract.verifyVoterCredentials(_voterCnic, passwordHash), "Invalid voter credentials");
        
        (,,,,bool hasVoted,) = voterContract.viewVoter(_voterCnic);
        require(!hasVoted, "Already voted");
        require(bytes(_secretKey).length >= 6, "Secret key must be at least 6 characters");
        
        bytes32 secretKeyHash = keccak256(abi.encodePacked(_secretKey));
        voterContract.setSecretKeyHash(_voterCnic, secretKeyHash);
        
        emit SecretKeyRegistered(_voterCnic);
    }
    
    // Cast Vote (Step 2 of voting)
    function castVote(
        uint256 _voterCnic,
        string memory _password,
        uint256 _candidateId,
        string memory _secretKey
    ) external withinVotingPeriod {
        // Verify voter credentials
        bytes32 passwordHash = keccak256(abi.encodePacked(_password));
        require(voterContract.verifyVoterCredentials(_voterCnic, passwordHash), "Invalid voter credentials");
        
        // Check if already voted
        (,,,,bool hasVoted,) = voterContract.viewVoter(_voterCnic);
        require(!hasVoted, "Already voted");
        
        // ✅ FIXED: Verify secret key matches registered one
        bytes32 storedSecretHash = voterContract.getVoterSecretKeyHash(_voterCnic);
        require(storedSecretHash != bytes32(0), "Secret key not registered. Register first.");
        
        bytes32 providedSecretHash = keccak256(abi.encodePacked(_secretKey));
        require(storedSecretHash == providedSecretHash, "Invalid secret key");
        
        // Get voter's constituency
        (string memory voterProvince, string memory voterConstituency) = voterContract.getVoterConstituency(_voterCnic);
        
        // Verify candidate exists
        (,,,string memory candidateProvince, string memory candidateConstituency,) = candidateContract.viewCandidate(_candidateId);
        
        // Verify candidate is in voter's constituency
        require(
            keccak256(bytes(candidateProvince)) == keccak256(bytes(voterProvince)) &&
            keccak256(bytes(candidateConstituency)) == keccak256(bytes(voterConstituency)),
            "Candidate not in your constituency"
        );
        
        // Record vote
        votes[_voterCnic] = _candidateId;
        bytes32 voteHash = keccak256(abi.encodePacked(_voterCnic, _candidateId, _secretKey, block.timestamp));
        voteHashes[_voterCnic] = voteHash;
        
        // Mark voter as voted
        voterContract.markAsVoted(_voterCnic);
        
        emit VoteCast(_voterCnic, voteHash, block.timestamp);
    }
    
    // ✅ FIXED: Verify My Vote - now properly verifies secret key
    function verifyMyVote(
        uint256 _voterCnic,
        string memory _secretKey
    ) external view returns (uint256 candidateId, bool verified) {
        (,,,,bool hasVoted,) = voterContract.viewVoter(_voterCnic);
        require(hasVoted, "You haven't voted yet");
        
        // Verify secret key
        bytes32 storedSecretHash = voterContract.getVoterSecretKeyHash(_voterCnic);
        bytes32 providedSecretHash = keccak256(abi.encodePacked(_secretKey));
        
        if (storedSecretHash == providedSecretHash) {
            return (votes[_voterCnic], true);
        } else {
            return (0, false);
        }
    }
    
    // Get voting status
    function getVotingStatus() external view returns (
        bool active,
        uint256 startTime,
        uint256 endTime,
        uint256 currentTime
    ) {
        return (votingActive, votingStartTime, votingEndTime, block.timestamp);
    }
    // ✅ ADD THIS NEW FUNCTION HERE
    function getVoterVote(uint256 _voterCnic) external view returns (uint256) {
        return votes[_voterCnic];
    }

}

